import React from "react";
import VideoItem from './VideoItem'

const VideoList = (props) => {
  const searchResults = props.searchResults
  const videoList = searchResults.map((video, i)=>  <VideoItem key={i} thumbnail={video.snippet.thumbnails.medium.url} channelId={video.snippet.channelId} title={video.snippet.title} />)
  return (
    <div className="ui items">
      {videoList}
      <hr />
    </div>
  );
};

export default VideoList;
